  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:29.907817\",\n\t\"name\": \"2011-invasive-non-native-plant-inventory-san-diego-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"San Diego National Wildlife Refuge (NWR)
  was one of four refuges selected to participate in a NWRS pilot project to evaluate
  the similarities and differences in invasive plant inventory objectives and methods
  across a variety of refuge environments. Pilot refuges were selected to represent
  a diverse array of characteristics including diversity of ecosystems, presence of
  federally listed species, level of staffing and expertise, level of partner engagement,
  spatial scale, and presence of other natural resource stressors. Results of the
  pilot project will inform development of a standardized guide or process for conducting
  invasive plant inventories on refuge lands. There are over 100 federally listed
  species in the San Diego region and 13 of these are known to occur on the refuge.
  As part of the pilot project, Utah State University was asked to conduct an inventory
  for targeted invasive non-native plants within selected portions of the refuge.
  While the purpose of the larger project is to inform a NWRS guide to conducting
  inventories, this inventory also provided valuable information to support San Diego
  National Wildlife Refuge conservation goals.\",\n\t\"license_title\": \"License
